import React from 'react';
import { useSelector } from "react-redux";
// import { useParams } from "react-router-dom";

export const Product = () => {

    // const { category } = useParams();

    // console.log(category);
    const res = useSelector((state) => state.data);

    // console.log(res)

    return (
        <div>
            <h1>Show Products</h1>
            {
                res.map((data, index) => {
                    return (
                        <>
                            <div key={index}>
                                <h1>{data.title}</h1>
                            </div>
                        </>
                    )
                })
            }

        </div>
    )
}
